Một file mã nguồn của Rust có phần mở rộng là .rs . Gõ lại đoạn mã sau là lưu lại với tên bất kỳ cùng với .rs ( helloworld.rs chẳng hạn). Rust có hỗ trợ trên vim, Sublime Text, VS Code,... Nếu bạn muốn mình chọn dùm, mình chọn Sublime Text với package Rust Enhanced (giúp bạn kiểm tra code khi save). Nếu bạn chưa cài đặt Rust vào máy thì bạn cũng có thể truy cập play.rust-lang.org gõ lại đoạn mã sau vào. // Đây là comment 1 dòng
/* Đây là comment nhiều dòng. */ fn main() { println!("Hello world!");
} Nếu bạn sử dụng Rust Playground thì chỉ cần nhấn Run thì chương trình sẽ được compile online và in dòng "Hello world!" ra màn hình. Rất đơn giản phải không nào? :joy: Nếu bạn muốn compile offline (sẽ nói chi tiết hơn ở mục sau), mở cửa sổ dòng lệnh, hãy chắc ăn là thư mục làm việc hiện hành (current working directory) đang chứa file cần compile, rồi gõ rustc helloworld.rs (nếu bạn đã đặt tên nó là helloworld.rs ). Sau đó chạy ./helloworld (Linux) hoặc .\helloworld.exe (Windows). Kết quả cũng tương tự với cách trên. Ta xét từng chi tiết của chương trình trên: Với comment, không còn gì rõ ràng hơn: // : sẽ đánh dấu nội dung phía sau là comment cho đến hết dòng. /* : sẽ đánh dấu nội dung phía sau là comment cho đến ghi gặp */ . Các cú pháp comment có dạng /// hay //! sẽ có thêm chức năng: dùng nội dung comments để tạo ra tài liệu cho thư viện/ứng dụng đó. Một chương trình thực thi viết bằng Rust sẽ phải có hàm main (nếu là thư viện, hàm main là không cần thiết). Trong hàm main này: fn : là từ khóa bắt buộc (viết tắt: "function"). main : là định danh, trường hợp này, cụ thể là tên hàm, được phép dùng các ký tự từ: a—z, A—Z, 0—9, _. Nhưng: không được bắt đầu bằng số, không sử dụng các ký tự non—ascii (không thuộc bảng mã ASCII, vì Rust chưa hỗ trợ hoàn thiện) hay chỉ dùng '_' (đây được gọi là định danh đặc biệt ('reserved identifier'). Những trường hợp định danh khác (tên biến,...) cũng tuân theo quy luật này. Tên hợp lệ: SmileSweet, _sister_sadistic, sUrPrIsE69,... Tên không hợp lệ: 0service, _, skrâtâ... () : sau khi khai báo tên hàm, phần trong cặp ngoặc này sẽ chứa tên biến truyền vào. Hàm main luôn không có bất kỳ biến nào. Sau cặp ngoặc này sẽ khai báo kiểu trả về của hàm (chúng ta sẽ đi sâu vào ở các ngày tiếp theo). Kiểu trả về: Nếu không chỉ định kiểu trả về, Rust mặc định trả về kiểu Unit () (không giống void trong C/C++). Hàm main có thể trả về kiểu khác: Result<()> nhưng chúng ta chưa đề cập phần này ở đây. {} : khối lệnh sẽ được đặt trong cặp ngoặc nhọn. Các biến được khởi tạo phạm vi (scope) này sẽ được tự động hủy khi ra khỏi scope. ; : ký tự đánh dấu kết thúc lệnh. Lưu ý: trường hợp duy nhất không dùng ; là khi rút ngắn cho lệnh return (sẽ đề cập sau). println! : là một macro (vì theo sau là dấu ! ), không nên nhầm lẫn với hàm (không được kết thúc với ! ). Hệ thống macro trong Rust cực kỳ mạnh mẽ và cũng khá khó (hơn nhiều so với C/C++), nên mình sẽ hướng dẫn sử dụng chứ không hướng dẫn cách viết macros. "..." : Rust sử dụng dấu ngoặc kép để đánh dấu chuỗi. Một chuỗi trong Rust luôn luôn là một chuỗi Unicode hợp lệ . Nâng cao: vì lẽ đó, Rust không cho phép bạn đánh chỉ số của chuỗi như các ngôn ngữ lập trình phổ biến khác! Nhưng sẽ có cách khác để làm việc này. Sẽ đề cập sau :p Kết: Viết nhiều như thế nhưng có lẽ đa số các bạn đều đã biết hết rồi (vì phần này cũng không khác C/C++ gì cho lắm). Phát triển: Hãy thử thay chuỗi "Hello world!" bằng một chuỗi khác xem. Chẳng hạn một chuỗi "trái tim lấp lánh 💖" chẳng hạn?
